func (c *current) onFieldNameList1(first, rest any) (any, error) {
	// Convert `rest` to a slice. Each element of the slice will be a 2-element
	// slice where the first element is ", " and the second is a FieldName.
	restSlice := rest.([]any)

	numFieldNames := 1 + len(restSlice)
	fields := make([]string, numFieldNames)
	fields[0] = first.(string)

	for i := 1; i < numFieldNames; i++ {
		separatorAndField := restSlice[i-1].([]any)
		fields[i] = separatorAndField[1].(string)
	}

	return fields, nil
}

func (p *parser) callonFieldNameList1() (any, error) {
	stack := p.vstack[len(p.vstack)-1]
	_ = stack
	return p.cur.onFieldNameList1(stack["first"], stack["rest"])
}

func (c *current) onEarliestAndLatest1(earliestTime, latestTime any) (any, error) {
	var startEpoch int64 = 0
	var endEpoch int64 = 0
	var err error

	earliestTimeModifier := earliestTime.(ast.RelativeTimeModifier)
	latestTimeModifier := latestTime.(ast.RelativeTimeModifier)

	currTime := time.Now()
	if earliestTimeModifier.AbsoluteTime != "" {
		startEpoch, err = ConvertCustomDateTimeFormatToEpochMs(earliestTimeModifier.AbsoluteTime)
		if err != nil {
			return nil, err
		}
	} else {
		offsetNum := earliestTimeModifier.RelativeTimeOffset.Offset
		offsetTimeUnit := earliestTimeModifier.RelativeTimeOffset.TimeUnit
		snap := earliestTimeModifier.Snap
		t := currTime
		if offsetNum != 0 {
			t, err = applyOffset(offsetNum, offsetTimeUnit, t)
			if err != nil {
				return nil, err
			}
		}
		if snap != "" {
			t, err = applySnap(snap, t)
			if err != nil {
				return nil, err
			}
		}
		startEpoch = t.UnixMilli()
	}

	if latestTimeModifier.AbsoluteTime != "" {
		endEpoch, err = ConvertCustomDateTimeFormatToEpochMs(latestTimeModifier.AbsoluteTime)
		if err != nil {
			return nil, err
		}
	} else {
		offsetNum := latestTimeModifier.RelativeTimeOffset.Offset
		offsetTimeUnit := latestTimeModifier.RelativeTimeOffset.TimeUnit
		snap := latestTimeModifier.Snap
		t := currTime
		if offsetNum != 0 {
			t, err = applyOffset(offsetNum, offsetTimeUnit, t)
			if err != nil {
				return nil, err
			}
		}
		if snap != "" {
			t, err = applySnap(snap, t)
			if err != nil {
				return nil, err
			}
		}
		endEpoch = t.UnixMilli()
	}

	// Create AST node
	node := &ast.Node{
		NodeType: ast.TimeModifierNode,
		TimeModifiers: &ast.TimeModifiers{
			StartEpoch: uint64(startEpoch),
			EndEpoch:   uint64(endEpoch),
		},
	}

	return node, nil
}

